    false,nt"url": null,nt"notes": "This narrative report for Lacreek Migratory
    Waterfowl Refuge outlines Refuge accomplishments from November through January of
    1942. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, predators, rodents, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include haying and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section discusses recreational
    uses, Refuge visitors, and hunting. Photographs are attached.",nt"owner_org":
